import styled from "styled-components";
import { withProps } from "../util";

const Line = ({ type, ...props }) => {
  switch (type) {
    case "Vertical":
      return withProps(Vertical);
      break;
    case "Horizontal":
      return Horizontal;
      break;
    default:
      return withProps(Vertical);
  }
};

const Horizontal = styled.div`
  height: 1px;
  background: black;
  width: 60px;
`;

const Vertical = styled(Horizontal)`
  transform: rotate(90deg);
`;

export default Line;
